import React from 'react';
import { Container, Nav, Navbar as NavbarBs } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

export function Navbar() {
    return (
        <NavbarBs sticky="top" bg="dark" variant="dark" className="shadow-sm mb-3">
            <Container>
                <NavbarBs.Brand as={NavLink} to="/" className="text-light">
                    My App
                </NavbarBs.Brand>
                <Nav className="ms-auto">
                    {/* Links for Sign Up and Sign In */}
                    <Nav.Link to="/signup" as={NavLink}>
                        Sign Up
                    </Nav.Link>
                    <Nav.Link to="/signin" as={NavLink}>
                        Sign In
                    </Nav.Link>
                    {/* Link for Home (conditionally render this when the user is signed in) */}
                    <Nav.Link to="/home" as={NavLink}>
                        Home
                    </Nav.Link>
                </Nav>
            </Container>
        </NavbarBs>
    );
}
